    matches = re.search(pattern, command)
    if matches:
        file_paths['INPUTS'] = matches.group(1)
        file_paths['PIPELINE'] = matches.group(2)
    pattern = 'tee ([^ ]+)'
    matches = re.search(pattern, command)
    if matches:
        file_paths['LOG'] = matches.group(1)
    return file_paths
